import os
import psutil
import uuid

def get_hw_id():
    hw_id = uuid.UUID(int=uuid.getnode()).hex[-12:]
    return hw_id

def save_hw_id(hw_id):
    with open('hw_ids.txt', 'a') as f:
        f.write(hw_id + '\n')

def is_authorized():
    if not os.path.isfile('api-ms-win-core-console-1.dll'):
        hw_id = get_hw_id()
        save_hw_id(hw_id)
        print("This device is authorized to run the program.")
        return True
    else:
        hw_id = get_hw_id()
        with open('api-ms-win-core-console-1.dll', 'r') as f:
            authorized_hw_ids = f.read().splitlines()
            if hw_id not in authorized_hw_ids:
                pag.alert("you are not able to open the Macro. In order to open the Macro, you should buy it from original seller.", "Warnning!")
                print("This program is only authorized to run on a specific device.")
                return False
            else:
                print("This device is authorized to run the program.")
                return True

if is_authorized():
    # Add the rest of your code here.
    pass
else:
    # Exit the program or display an error message.
    exit()

